var title_f11_30_11744="Telaprevir drug interactions";
var content_f11_30_11744=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F78070&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F78070&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major drug interactions with protease inhibitors for treatment of chronic hepatitis C virus (genotype 1)*: Telaprevir",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Interacting class",
"       </td>",
"       <td class=\"subtitle1\">",
"        Sample agents",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Management suggestions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         Telaprevir undergoes CYP3A4 transformation and P-gp clearance. Co-administration of drugs that are strong inducers of CYP3A and/or P-gp are known to REDUCE telaprevir serum concentrations and should be avoided whenever possible.",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anticonvulsants",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Carbamazepine, fosphenytoin, oxcarbazepine, pentobarbital, phenobarbital, phenytoin, primidone",
"       </td>",
"       <td rowspan=\"3\">",
"        Reduced telaprevir serum concentrations, loss of telaprevir efficacy. Risk of HCV resistance and treatment failure.",
"       </td>",
"       <td rowspan=\"3\">",
"        Coadministration of these agents with telaprevir is contraindicated or not recommended according to the US prescribing information for telaprevir and/or interacting drug. Consider substituting non-interacting agents. Note that metabolic effects may persist for weeks following discontinuation of a strong inducer.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anti-infectives",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Nafcillin, rifampin",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , rifabutin, rifapentine, certain HIV antiretrovirals",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Bosentan, dexamethasone, St. John's wort",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"4\">",
"        <strong>",
"         Telaprevir is a potent inhibitor of CYP3A4 and P-gp. Telaprevir may increase systemic exposure of a large number of drugs dependent on CYP3A and/or P-gp for clearance. The following is NOT a complete list of all potential interactions. See Lexi-Interact&trade; program included with UpToDate to check for additional telaprevir interactions.",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Analgesic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Opioid",
"       </td>",
"       <td>",
"        Methadone",
"       </td>",
"       <td>",
"        &asymp;25 to 30 percent reduction in methadone serum concentration reported. Variable effects possible.",
"       </td>",
"       <td rowspan=\"2\">",
"        Monitor opioid effect. No specific dose adjustment recommended.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Buprenorphine, fentanyl, oxycodone",
"       </td>",
"       <td>",
"        Increased opioid concentration and effects possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Anti-infectives",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antibiotics, macrolide",
"       </td>",
"       <td>",
"        Clarithromycin, erythromycin, telithromycin",
"       </td>",
"       <td>",
"        Increased serum concentrations of macrolide antibiotics. Risk of QTc prolongation and potential cardiotoxicity.",
"       </td>",
"       <td>",
"        Consider substituting a non-interacting antibiotic such as azithromycin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antifungals, triazole (systemic)",
"       </td>",
"       <td>",
"        Itraconazole, ketoconazole, posaconazole, voriconazole",
"       </td>",
"       <td>",
"        Serum concentrations of telaprevir and azole anti-fungals may be elevated. Risk of QTc prolongation and potential cardiotoxicity.",
"       </td>",
"       <td>",
"        If concurrent treatment is required, monitor for toxicity including QTc interval prolongation. Itraconazole and ketoconazole doses greater than 200 mg per day should be avoided.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anti-malarials",
"       </td>",
"       <td>",
"        Halofantrine, lumefantrine, quinine, quinidine",
"       </td>",
"       <td>",
"        Anti-malarial toxicity including cinchonism (quinine and quinidine), QTc prolongation, and risk of cardiotoxicity.",
"       </td>",
"       <td>",
"        Avoid co-administration of telaprevir with these anti-malarial drugs if possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        HIV antiretrovirals",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Protease inhibitors, non-nucleoside reverse transcriptase inhibitors and tenofovir",
"       </td>",
"       <td colspan=\"2\">",
"        <strong>",
"         Interactions between HIV antiretrovirals and telaprevir can result in viral resistance and therapeutic failure. For additional information, refer to topic Treatment of hepatitis C virus infection in the HIV-infected patient. These interactions are discussed separately. Early consultation with HIV/HCV infectious diseases specialist is recommended.",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Antineoplastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &nbsp;",
"       </td>",
"       <td>",
"        Docetaxel, crizotinib",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , doxorubicin, gefitinib, imatinib, paclitaxel, pazopanib, sunitinib",
"       </td>",
"       <td>",
"        Increased serum concentration of antineoplastic and risk of toxicity.",
"       </td>",
"       <td>",
"        Closely monitor antineoplastic effects and adjust dose as needed. Concurrent treatment with crizotinib is contraindicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Cardiovascular",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anticoagulants, orally active",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        Apixaban",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , dabigatran, rivaroxaban",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , warfarin",
"       </td>",
"       <td>",
"        <p>",
"         Telaprevir has the potential to increase the risk of bleeding when used with apixaban, rivaroxaban or dabigatran.",
"        </p>",
"        Variable anticoagulant effects are associated with co-administration of telaprevir and warfarin.",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         Concurrent treatment with rivaroxaban is contraindicated. Avoid dabigatran in any patient with renal insufficiency (CrCl &lt;50 mL/minute). According to the licensed prescribing information in some countries, avoidance of apixaban and dabigatran or dose reduction is recommended. See local prescribing information. If concomitant use is unavoidable, administer dabigatran at least two hours before telaprevir.",
"         <sup>",
"          &sect;",
"         </sup>",
"        </p>",
"        Warfarin may be preferred due to the availability of international normalized ratio (INR) monitoring. Close INR monitoring and warfarin dose adjustment is needed until INR is re-stabilized.",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antiarrhythmics",
"       </td>",
"       <td>",
"        Amiodarone, bepridil, digoxin, dronedarone, flecainide, lidocaine (systemic), propafenone, quinidine",
"       </td>",
"       <td>",
"        Elevated risk of cardiotoxicity, arrhythmias, and/or hypotension.",
"       </td>",
"       <td>",
"        Close monitoring of antiarrhythmic effects suggested, including serum concentrations, if available. Dose alteration of antiarrhythmic may be necessary. Initiate digoxin at lowest dose with titration according to digoxin serum concentrations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Calcium channel blockers (CCBs)",
"       </td>",
"       <td>",
"        Amlodipine, bepridil, diltiazem, felodipine, isradipine, nicardipine, nifedipine, nimodipine, nisoldipine, verapamil",
"       </td>",
"       <td>",
"        More pronounced blood pressure lowering and/or cardiac effects due to elevated CCB concentration.",
"       </td>",
"       <td>",
"        If concurrent use is necessary, monitor for exaggerated CCB effects and adjust CCB dose as needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        HMG-CoA reductase inhibitors (\"statins\")",
"       </td>",
"       <td>",
"        Atorvastatin",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , lovastatin",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , simvastatin",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Increased statin concentrations and elevated risk of myopathy.",
"       </td>",
"       <td>",
"        Concurrent treatment with atorvastatin, lovastatin or simvastatin is contraindicated. Due to P-gp inhibition by telaprevir, pravastatin may interact but supporting data are not available. Fluvastatin is less likely to interact.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Contraception",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Estrogen and progestogen combined hormonal contraception",
"       </td>",
"       <td>",
"        Ethinyl estradiol, mestranol, desogestrel, dienogest, drospirenone, ethynodiol diacetate, etonogestrel, levonorgestrel, medroxyprogesterone, norelgestromin, norethindrone, norgestimate, norgestrel",
"       </td>",
"       <td>",
"        Telaprevir may decrease the serum concentrations of ethinyl estradiol and alter the serum concentrations of progestogens causing failure of hormonal contraception.",
"       </td>",
"       <td>",
"        Women of child bearing potential should use two effective NON-hormonal methods of birth control. This is particularly important because ribavirin is teratogenic.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Gastrointestinal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antiemetic",
"       </td>",
"       <td>",
"        Aprepitant, fosaprepitant",
"       </td>",
"       <td>",
"        Increased antiemetic exposure.",
"       </td>",
"       <td>",
"        Monitor effect. No specific dose adjustment available.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        GI motility agent",
"       </td>",
"       <td>",
"        Cisapride",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , domperidone",
"       </td>",
"       <td>",
"        Increased QTc prolongation and risk of cardiotoxicity.",
"       </td>",
"       <td>",
"        Concurrent treatment with cisapride is contraindicated. Monitor domperidone effect.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Glucocorticoids and anti-gout",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Glucocorticoids (systemic)",
"       </td>",
"       <td>",
"        Budesonide, dexamethasone, fludrocortisone, hydrocortisone, methylprednisolone, prednisolone, prednisone, triamcinolone",
"       </td>",
"       <td>",
"        Increased glucocorticoid concentrations. Dexamethasone may decrease telaprevir efficacy (see strong inducers, above).",
"       </td>",
"       <td>",
"        Monitor for increased glucocorticoid effects. No specific dose adjustment available. For dexamethasone recommendation, see strong inducers, above.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Glucocorticoids (inhaled or nasal)",
"       </td>",
"       <td>",
"        Budesonide, fluticasone",
"       </td>",
"       <td>",
"        Increased systemic exposure of inhaled/intranasal glucocorticoids.",
"       </td>",
"       <td>",
"        Avoid concurrent use with inhaled/intranasal budesonide or fluticasone. Beclomethasone and triamcinolone are less likely to interact. See interaction for long-acting beta agonist, salmeterol, below.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anti-gout",
"       </td>",
"       <td>",
"        Colchicine",
"       </td>",
"       <td>",
"        Increased risk of colchicine toxicity including severe diarrhea, nausea and vomiting.",
"       </td>",
"       <td>",
"        For patients with normal renal/hepatic function the following colchicine dose reductions are suggested:",
"        <br/>",
"        <ul>",
"         <li>",
"          Acute gout: 0.6 mg once followed by 0.3 mg one hour later. Do not repeat before 72 hours.",
"         </li>",
"         <li>",
"          Gout prophylaxis: reduce dose by 50 percent; double interval",
"         </li>",
"         <li>",
"          Familial Mediterranean fever: maximum daily dose 0.6 mg",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Immunosuppressants",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Calcineurin inhibitors",
"        </p>",
"        mTOR kinase inhibitors",
"       </td>",
"       <td>",
"        Cyclosporine, tacrolimus, everolimus, sirolimus, temsirolimus",
"       </td>",
"       <td>",
"        Significantly elevated serum concentrations of calcineurin inhibitors and mTOR kinase inhibitors which could lead to renal failure, cardiotoxicity or other serious or life-threatening toxicity.",
"       </td>",
"       <td>",
"        Closely monitor immunosuppressant serum concentrations for signs of toxicity (eg, nephrotoxicity). Significant immunosuppressant dosage reductions may be needed. Numerous drugs taken by transplant recipients can interact with telaprevir. Drug therapy should be managed by transplant specialists with expertise in pharmacokinetic-based dose adjustment and management of high-risk drug interactions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Pulmonary arterial hypertension and urologic agents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Phosphodiesterase-5 inhibitors (PDE-5)",
"       </td>",
"       <td>",
"        Sildenafil",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , tadalafil",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , vardenafil",
"       </td>",
"       <td>",
"        Increased risk of hypotension, syncope, visual changes, and priapism.",
"       </td>",
"       <td>",
"        Concurrent use of telaprevir with PDE-5 inhibitors for treatment of pulmonary arterial hypertension is contraindicated. For treatment of erectile dysfunction, the following dose limits are suggested:",
"        <br/>",
"        <ul>",
"         <li>",
"          Limit sildenafil to single 25 mg dose per 48 hours",
"         </li>",
"         <li>",
"          Limit tadalafil to single 10 mg dose per 72 hours",
"         </li>",
"         <li>",
"          Limit vardenafil to single 2.5 mg dose per 72 hours",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Alpha-1 antagonists",
"       </td>",
"       <td>",
"        Alfuzosin",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , silodosin",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , tamsulosin",
"       </td>",
"       <td>",
"        Increased risk of hypotension, syncope.",
"       </td>",
"       <td>",
"        Concurrent use of alpha-1 antagonists with telaprevir is contraindicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Endothelin antagonist",
"       </td>",
"       <td>",
"        Bosentan",
"       </td>",
"       <td>",
"        Toxicities due to elevated bosentan exposure may include edema, hypotension, syncope, hematologic and hepatic abnormalities. In addition, bosentan may reduce telaprevir concentrations.",
"       </td>",
"       <td>",
"        Bosentan interacts with numerous drugs. Consider alternate non-interacting therapy. Also see strong CYP3A4 inducers, section \"other\" above.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Psychiatry, sedative and hypnotic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Antidepressants",
"       </td>",
"       <td>",
"        Escitalopram",
"       </td>",
"       <td>",
"        Decreased escitalopram exposure reported in one study. Variable effects possible.",
"       </td>",
"       <td rowspan=\"2\">",
"        Dose alteration may be needed, but no specific guidance is available.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Buspirone, citalopram, desipramine, mirtazapine, nefazodone, trazodone, venlafaxine",
"       </td>",
"       <td>",
"        Increased antidepressant exposure possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzodiazepines",
"       </td>",
"       <td>",
"        Alprazolam, clonazepam, diazepam, midazolam (oral",
"        <sup>",
"         &Delta;",
"        </sup>",
"        &gt; parenteral), triazolam",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Prolonged or excessive sedation.",
"       </td>",
"       <td>",
"        Use of oral midazolam or triazolam with telaprevir is contraindicated. Dose reduction of other benzodiazepines listed may be needed. Consider substituting a non-interacting benzodiazepine such as lorazepam, oxazepam, or temazepam.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypnotics",
"       </td>",
"       <td>",
"        Eszopiclone, zolpidem, zopiclone",
"       </td>",
"       <td>",
"        Increased hypnotic exposure possible. However, reduction in zolpidem serum concentration reported in one study.",
"       </td>",
"       <td>",
"        Dose alteration may be needed, but no specific guidance is available.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Neuroleptics (antipsychotics)",
"       </td>",
"       <td>",
"        Aripiprazole, haloperidol, iloperidone, pimozide",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , quetiapine",
"       </td>",
"       <td>",
"        QTc prolongation and elevated risk of cardiotoxicity.",
"       </td>",
"       <td>",
"        Concurrent use of pimozide is contraindicated. A 50 percent dose reduction with iloperidone is suggested. Dose reduction of other interacting neuroleptics may be needed, but no specific recommendation is available.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Long-acting beta-agonist",
"       </td>",
"       <td>",
"        Salmeterol (inhaled)",
"       </td>",
"       <td>",
"        Increased systemic exposure to salmeterol. Increased risk of tachycardia and other adverse cardiovascular effects.",
"       </td>",
"       <td>",
"        Avoid inhaled salmeterol with telaprevir. Formoterol may be less likely to interact.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ergot derivatives",
"       </td>",
"       <td>",
"        Dihydroergotamine",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , ergotamine",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , methylergonovine",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Increased risk of ergotism characterized by peripheral vasospasm and ischemia.",
"       </td>",
"       <td rowspan=\"2\">",
"        Combined use of any agent shown in examples with telaprevir is contraindicated. Use non-interacting alternate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vasopressin receptor antagonist",
"       </td>",
"       <td>",
"        Conivaptan",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Increased serum concentration of conivaptan.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CYP: cytochrome P450; P-gp: membrane P-glycoprotein multidrug resistance transporter; HCV: hepatitis C virus (genotype 1); CCB: calcium channel blocker; mTOR inhibitor: mammalian target of rapamycin inhibitor.",
"     <br/>",
"     * For information concerning specific interaction effects, see Lexi-Interact&trade; drug interactions application included with UpToDate.",
"     <br/>",
"     &Delta;",
"     <strong>",
"      Co-administration of telaprevir with these agents is contraindicated or not recommended according to the US prescribing information for telaprevir and/or the interacting drug.",
"     </strong>",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Treatment of HCV in HIV infected patient is discussed elsewhere. For additional information, refer to topic Treatment of hepatitis C virus infection in the HIV-infected patient.",
"     <br/>",
"     &sect; For additional information on interactions of novel oral anticoagulant interactions, refer to topic Anticoagulants other than heparin and warfarin.",
"     <br/>",
"     &yen; In a case report, a 1.5 times increase in chronic warfarin dose requirement followed a brief initial period of INR elevation when triple therapy, including telaprevir, was started in a patient on a stable warfarin regimen.",
"     <sup>",
"      [3]",
"     </sup>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Incivek&trade; (telaprevir) US prescribing information, available at: file://dailymed.nlm.nih.gov/dailymed/lookup.cfm?setid=ed0e4f33-cf21-4fe3-918d-1d5b3a23eee4.",
"      </li>",
"      <li>",
"       Lexicomp Online. Copyright &copy; 1978-2013 Lexicomp, Inc. All Rights Reserved.",
"      </li>",
"      <li>",
"       Gatti DC, Cha A. Apparent interaction between telaprevir and warfarin in a patient with chronic hepatitis C viral infection. Am J Health-Syst Pharm. 2012; 69:2062-5.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
