var title_f11_30_11748="Bypass revision for brachiocephalic fistula steal";
var content_f11_30_11748=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F76970&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F76970&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 484px\">",
"   <div class=\"ttl\">",
"    Bypass revision for brachiocephalic fistula steal",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 464px; height: 653px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Surgical options for bypass revision for brachiocephalic fistula steal are illustrated in the figure.",
"    <br>",
"     (A) Distal revascularization-interval ligation (DRIL):&nbsp;The brachial artery just distal to the anastomosis is ligated, and a bypass&nbsp;is created from the more proximal&nbsp;brachial artery to the&nbsp;proximal radial artery. The distal circulation is dependant upon the new bypass.",
"     <br>",
"      (B) Revision Using Distal Inflow (RUDI): The origin of the fistula is ligated on the venous side followed by&nbsp;a revsion from a more distal arterial source to the venous limb. In contrast to the DRIL procedure, the RUDI procedure&nbsp;maintains the native arterial circulation.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
