"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/30/11752/abstract/2\">",
"      Chang TT, Gish RG, de Man R, et al. A comparison of entecavir and lamivudine for HBeAg-positive chronic hepatitis B. N Engl J Med 2006; 354:1001.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/30/11752/abstract/3\">",
"      Gish RG, Lok AS, Chang TT, et al. Entecavir therapy for up to 96 weeks in patients with HBeAg-positive chronic hepatitis B. Gastroenterology 2007; 133:1437.",
"     </a>",
