var title_f11_30_11756="Interpretation of sweat chloride";
var content_f11_30_11756=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F88515&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F88515&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Interpretation of sweat chloride test results for diagnosis of cystic fibrosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Sweat chloride concentration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Result",
"       </td>",
"       <td class=\"subtitle1\">",
"        Interpretation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Newborn to 6 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &le;29 mmol/L",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        CF very unlikely",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        30 to 59 mmol/L",
"       </td>",
"       <td>",
"        Intermediate",
"       </td>",
"       <td>",
"        Possible CF, additional testing recommended*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;60 mmol/L",
"       </td>",
"       <td>",
"        Abnormal",
"       </td>",
"       <td>",
"        Diagnosis of CF, if confirmed by a second test and if clinical symptoms consistent with CF are present",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Infants &ge;6 months, children and adults",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &le;39 mmol/L",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        CF very unlikely",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        40 to 59 mmol/L",
"       </td>",
"       <td>",
"        Intermediate",
"       </td>",
"       <td>",
"        Possible CF, additional testing recommended*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;60 mmol/L",
"       </td>",
"       <td>",
"        Abnormal",
"       </td>",
"       <td>",
"        Diagnosis of CF, if confirmed by a second test and if clinical symptoms consistent with CF are present",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CF: cystic fibrosis.",
"     <br/>",
"     * Additional testing usually consists of molecular diagnosis (DNA analysis) and a second sweat test.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Clinical symptoms of CF are not required among newborns identified through a screening program, or among siblings of patients with CF who are diagnosed by shared genotype.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Farrell PM, Rosenstein BJ, White TB, et al. Guidelines for diagnosis of cystic fibrosis in newborns through older adults: Cystic Fibrosis Foundation consensus report. J Pediatr 2008; 153:S4.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
